 **************************************/


@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("last.fm") {


  /* Images
  ------------------------------------- */
  
 /* http://panther1.last.fm/depth/header2/red_logo.jpg */
  img[src*="_logo.jpg"] {
          background: url('data:image/png;base64,') top left no-repeat !important;
    width: 0 !important;
    height: 41px !important;
    padding-left: 207px !important;
  }

 /* http://cdn.last.fm/depth/header2/red_gradient.gif */
  #LastHeader {
    background: url('data:image/gif;base64,')  top left repeat-x #00a500 !important;
  }
  
 /* http://cdn.last.fm/depth/header2/red_rollover.gif */
  #navigation li a:hover, #navigation li.current a {
    background:transparent url('data:image/gif;base64,') repeat-x scroll left top !important;
  }
  
 /* http://cdn.last.fm/depth/sidebars/panels/top_red.gif */
  div.lastPanel:not([class~="noHeader"]) div.h
  {
    background: transparent url('data:image/png;base64,') no-repeat scroll left top !important;
  }
  
 /* http://cdn.last.fm/depth/sidebars/list.gif */
  #LastWebsite a.textTog, #LastWebsite a.imgTog {
    background:transparent url('data:image/gif;base64,') no-repeat scroll left top !important;
  }

 /* http://cdn.last.fm/depth/sidebars/minimise.gif */
  #LastWebsite a.collapseTog, #LastWebsite a.expandTog {
    background:transparent url('data:image/gif;base64,') no-repeat scroll left top !important;
  }

  /* http://cdn.last.fm/depth/layouts/fixed_width_960/top_red.gif */
  body.fixedWidth {
    background-image:url('data:image/gif;base64,') !important;
  }

  /* http://cdn.last.fm/depth/layouts/fixed_width_960/top_bg.gif */
  body.fixedWidth #LastWebsite {
    background-image:url('data:image/gif;base64,') !important;
  }
  
  /* http://cdn.last.fm/depth/sidebars/panels/top_red_newuser.gif */
  div.lastPanel.empty div.h {
    background: none !important;
    background-image:url('data:image/png;base64,') !important;
  }
  
  /* http://cdn.last.fm/depth/homepage/overlay.gif */
  #thisIsScrobbling {
    background:transparent url('data:image/gif;base64,') no-repeat scroll left top !important;
  }
  
  /* http://cdn.last.fm/depth/header2/signup_red_left.gif */
  a#signupLink {
    background-image:url('data:image/gif;base64,') !important;
  }
  
  /* http://cdn.last.fm/depth/header2/signup_red_right.gif */
  a#signupLink span {
    background-image:url('data:image/gif;base64,') !important;
  }
  

  /* Misc
  ------------------------------------- */

 /* #DA546A (61,85) */
  #headerBottom {
    border-top:1px solid #54da54 !important;
  }

 /* #F5B5B5 (26,96) */
  #headerBottom a {
    color:#b5f5b5 !important;
    border-top: none !important;
  }

 /* #F5B5B5 */  
  #headerBottom li:not(#toglink) {
    border-right:1px solid #b5f5b5 !important;
  }

 /* #7E1325 (85,49) */
  #headerSearchbox input.sbox {
    border:1px solid #137e13 !important;
  }

 /* #E17486 */
  li#toglink a:hover, body.black li#toglink a:hover {
    color:#74E174 !important;
  }

 /* #DA546A */
  li#toglink a {
    color:#54da54 !important;
  }

  
  div.displayCopy h2, .instructBox h4, .greenBoxQuickFix h2, .faqBox h3, .greenBox span, .greenBox h2,
   h3, h3 a, h3 a:link, h3 a:visited, h3 a:hover, #listenPageStarter input#userInput,
   ul.radioStations a.personal, div.sidebar ul.radioStations a.personal span,
   div.displayCopy h2 a, div.faqBox a,
   #listenPageStarter input#userInput,
   body.fixedWidth div.top input#favArtist,
   table.recentList tr.lastHour td.date,
   div#newEvent .error label,
   body.fixedWidth h1 {
    color:#00a500 !important;
  }
  
  a.pdfDownload:hover span {
    border-bottom:1px solid #00a500 !important;
  }
  
  div#widgetConfig dl dd img.red, body .errorBox a:hover {
    background:#00a500 none repeat scroll 0% !important;
  }
  
  div#quiltConfigurator div#moreOptions label.red img, table.recentList tr.now td {
    background-color:#00a500 !important;
  }


  /* Fixes
  ------------------------------------- */

  div.theDashboard table.recentList tr.now td {
    background-color:#E6E9F0 !important;
  }

  li#toglink {
    border-right: 0pt none !important;
  }

  #headerBottom a:hover, body.black #headerBottom a:hover {
    color:#FFFFFF !important;
    border-top: none !important;
  }
}
